// Função de Processamento de Dados
const processCsvData = (csvData: string, headers: string[]) => {
  return csvData.trim().split('\n')
    .map(line => line.trim())
    .filter(line => line !== '' && !line.startsWith('//'))
    .map(line => {
      // Divide por vírgulas, espaços ou múltiplos espaços
      const values = line.split(/[,\s]+/).map(v => v.trim()).filter(v => v !== '');
      if (values.length < headers.length) return null;

      const obj: { [key: string]: number } = {};
      headers.forEach((header, index) => {
        obj[header] = parseFloat(values[index]);
      });
      return obj;
    })
    .filter(obj => obj !== null && !Object.values(obj).some(isNaN)) as { [key: string]: number }[];
};


// Inicialização e Combinação dos Dados (Executado uma vez no nível do módulo)
const mockData = (() => {
  // 1. Processamento das séries de tempo/frame (RMSD e Rg)
  const rmsdSeriesRaw = processCsvData(RAW_CSV_DATA.RMSD_SERIES_CSV, ['frame', 'rmsdA', 'rmsdB']);
  const rgSeriesRaw = processCsvData(RAW_CSV_DATA.RG_SERIES_CSV, ['frame', 'rgA', 'rgB']);
  const residueSeriesRaw = processCsvData(RAW_CSV_DATA.RMSF_RESIDUE_SERIES_CSV, ['residue', 'rmsfA', 'rmsfB']);

  // Combinação de RMSD e Rg na mesma série temporal (baseada no 'frame')
  const timeSeriesMap = new Map();

  // Adiciona RMSD
  rmsdSeriesRaw.forEach(row => timeSeriesMap.set(row.frame, { frame: row.frame, rmsdA: row.rmsdA, rmsdB: row.rmsdB }));

  // Adiciona Rg (deve ter frames correspondentes)
  rgSeriesRaw.forEach(row => {
    if (timeSeriesMap.has(row.frame)) {
      timeSeriesMap.set(row.frame, {
        ...timeSeriesMap.get(row.frame),
        rgA: row.rgA,
        rgB: row.rgB
      });
    }
  });

  const timeSeries = Array.from(timeSeriesMap.values()).filter(item =>
    item.rmsdA !== undefined && item.rgA !== undefined
  );

  const residueSeries = residueSeriesRaw;

  // --- Fallback (simulação) se os dados reais estiverem vazios ou incompletos ---
  if (timeSeries.length < 2 || residueSeries.length < 2) {
      console.warn("Usando dados mockados. Cole seus dados reais na seção RAW_CSV_DATA.");

      const fallbackTimeSeries = Array.from({ length: 50 }, (_, i) => ({
        frame: i * 10,
        rmsdA: 1.0 + Math.sin(i / 10) * 0.5 + Math.random() * 0.2,
        rmsdB: 1.5 + Math.cos(i / 8) * 0.8 + Math.random() * 0.4,
        rgA: 1.8 + Math.sin(i / 15) * 0.1,
        rgB: 2.2 + Math.cos(i / 12) * 0.2,
      }));
      const fallbackResidueSeries = Array.from({ length: 150 }, (_, i) => ({
        residue: i + 1,
        rmsfA: 0.8 + Math.random() * 0.5 * Math.pow(Math.E, -Math.pow(i - 75, 2) / (2 * Math.pow(50, 2))),
        rmsfB: 1.5 + Math.random() * 0.8 * Math.pow(Math.E, -Math.pow(i - 75, 2) / (2 * Math.pow(70, 2))) + (i > 130 ? 0.5 : 0),
      }));

      return { timeSeries: fallbackTimeSeries, residueSeries: fallbackResidueSeries };
  }

  return { timeSeries, residueSeries };
})();


